import collections
from typing import List


# s = "cbaebabacd"
# p = "abc"

# s = "abab"
# p = "ab"

s = ""
p = ""

# s = "ababababab"
# p = "aab"

def findAnagrams(s: str, p: str) -> List[int]:
  n = len(p)
  pMap = collections.Counter(p) # O(n)
  sMap = collections.Counter(s[0:n]) # O(n)

  idx = []

  for i in range(len(s) - n + 1): # O(n)
    if sMap == pMap:
      idx.append(i)

    if sMap.get(s[i]) == 1:
      sMap.pop(s[i])
    elif sMap.get(s[i]):
      sMap[s[i]] -= 1
  
    if i+n < len(s):
      sMap[s[i+n]] = sMap.get(s[i+n], 0) + 1
  
  return idx

print(findAnagrams(s, p))